import React from 'react';
import { BrowserRouter as Router, Route, Switch, useHistory } from 'react-router-dom';
import NavigationBar from './components/NavigationBar';
import Footer from './components/Footer';
import Home from './screens/Home';
import Checkout from './screens/Checkout';
import Signin from './userform/Signin';
import Register from './userform/Register';
import Sidebar from './components/Sidebar';
import Forgetpassword from './forms/userform/ForgetPassword';
import NotFound from './screens/NotFound';
import Contact from './screens/Contact';
import Help from './screens/Help';
import Blog from './screens/Blog';
import Howindividuals from './screens/Howindividuals';

function App() { 
  const history = useHistory()   
    return (
      <React.Fragment>
        <Router>
          <NavigationBar />
          <Sidebar history = {history} />
          <Switch>
              <Route exact path="/" component={Home} />
              <Route exact path="/checkout" component={Checkout} />
              <Route path="/signin" component={Signin} />
              <Route path="/register" component={Register} />
              <Route path="/forgetpassword" component={Forgetpassword} />
              <Route path="/notfound" component={NotFound} />
              <Route path="/contact" component={Contact} />
              <Route path="/help" component={Help} />
              <Route path="/blog" component={Blog} />
              <Route path="/howitworks-individuals" component={Howindividuals} />
          </Switch>
          <Footer/>
        </Router>
      </React.Fragment>
   );
  }
  
  export default App;
